  <style>
    html {
      -ms-touch-action: none;
    }

    body,
    canvas,
    div {
      display: block;
      outline: none;
      -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
      -moz-user-select: none;
      -webkit-user-select: none;
      -ms-user-select: none;
      -khtml-user-select: none;
      -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
    }

    /* Remove spin of input type number */

    input::-webkit-outer-spin-button,
    input::-webkit-inner-spin-button {
      /* display: none; <- Crashes Chrome on hover */
      -webkit-appearance: none;
      margin: 0;
      /* <-- Apparently some margin are still there even though it's hidden */
    }

    body {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      padding: 0;
      border: 0;
      margin: 0;
      cursor: default;
      color: #888;
      background-color: #333;
      text-align: center;
      font-family: Helvetica, Verdana, Arial, sans-serif;
      display: flex;
      flex-direction: column;
    }

    #Cocos2dGameContainer {
      position: absolute;
      margin: 0;
      overflow: hidden;
      left: 0px;
      top: 0px;
      display: -webkit-box;
      -webkit-box-orient: horizontal;
      -webkit-box-align: center;
      -webkit-box-pack: center;
    }

    canvas {
      background-color: rgba(0, 0, 0, 0);
    }

    a:link,
    a:visited {
      color: #666;
    }

    a:active,
    a:hover {
      color: #666;
    }

    p.header {
      font-size: small;
    }

    p.footer {
      font-size: x-small;
    }

    .progress-bar {
      background-color: #1a1a1a;
      position: absolute;
      left: 30%;
      top: 80%;
      height: 15px;
      padding: 5px;
      width: 40%;
      /*margin: 0 -175px;         */
      border-radius: 5px;
      box-shadow: 0 1px 5px #000 inset, 0 1px 0 #444;
    }

    .progress-bar span {
      display: block;
      height: 100%;
      border-radius: 3px;
      box-shadow: 0 1px 0 rgba(255, 255, 255, 0.5) inset;
      transition: width 0.4s ease-in-out;
      background-color: #34c2e3;
    }

    .stripes span {
      background-size: 30px 30px;
      background-image: linear-gradient(135deg,
          rgba(255, 255, 255, 0.15) 25%,
          transparent 25%,
          transparent 50%,
          rgba(255, 255, 255, 0.15) 50%,
          rgba(255, 255, 255, 0.15) 75%,
          transparent 75%,
          transparent);
      animation: animate-stripes 1s linear infinite;
    }

    @keyframes animate-stripes {
      0% {
        background-position: 0 0;
      }

      100% {
        background-position: 60px 0;
      }

    var androidLink = 'https://play.google.com/store/apps/details?id=com.unimob.icy.village';
    var iosLink = 'https://apps.apple.com/vn/app/icy-village-tycoon-survival/id6470175895';
    var defaultLink = 'https://play.google.com/store/apps/details?id=com.unimob.icy.village';
    openAdUrl = function (adChanel) {
      if (cc.sys.os == cc.sys.OS_ANDROID) {
        clickTag = 'https://play.google.com/store/apps/details?id=com.unimob.icy.village';
      }
      else if (cc.sys.os == cc.sys.OS_IOS) {
        clickTag = 'https://apps.apple.com/vn/app/icy-village-tycoon-survival/id6470175895';
      } else {
        clickTag = 'https://play.google.com/store/apps/details?id=com.unimob.icy.village';
      }
      var adNetwork = '{{__adv_channels_adapter__}}';
      switch (adChanel) {
        case 'Mintegral':
          window.gameEnd && window.gameEnd();
          window.install && window.install();
          break;
        case 'Google':
          window.open(clickTag);
          break;
        case 'AppLovin':
          mraid.open(clickTag);
          break;
        case 'Facebook':
          FbPlayableAd.onCTAClick();
          break;
        case 'IronSource':
          mraid.openStoreUrl(clickTag);
          break;
        case 'Unity':
          mraid.open(clickTag);
          break;
        case 'Vungle':
          callSDK('download');
          break;
        default:
          window.open(clickTag);
      }
    }
  </script>
